import jsPDF from "jspdf";
(function (jsPDFAPI) {
  const marianneBold =
    "";
  var callAddFont = function () {
    this.addFileToVFS("Marianne-Bold.ttf", marianneBold);
    this.addFont("Marianne-Bold.ttf", "MarianneBold", "normal");
  };
  jsPDFAPI.events.push(["addFonts", callAddFont]);
})(jsPDF.API);
